import AnimatedButton from './catapp_components/AnimatedButton';
import './css/styles-game.css';
import './css/styles.css';

const MenuButtons = () => {

    const cmbStyle = {
        position: 'absolute',
        alignSelf: 'center',
        top: '365px',
    };

    const buttonStyle = {
        position: 'relative',
        height: '75px',
        width: '75px',
        marginRight: '10px',
    };

    return (
        <div id="cat-info-buttons" style={cmbStyle}>
        <AnimatedButton divID="cib1" imgSrc="/imgs/Button Create V2.png" additionalStyles={buttonStyle}/>
        <AnimatedButton divID="cib2" imgSrc="/imgs/Button Feed V2.png" additionalStyles={buttonStyle}/>
        <AnimatedButton divID="cib3" imgSrc="/imgs/Button Play V2.png" additionalStyles={buttonStyle}/>
        <AnimatedButton divID="cib4" imgSrc="/imgs/Button Dress V2.png" additionalStyles={buttonStyle}/>
    </div>
    );

};

export default MenuButtons;
